getPSDEDQConditions.condition:
t1.product IN (
			SELECT
				t.`id` 
			FROM
				zt_product t 
			WHERE
				t.`deleted` = '0' 
				AND (
					t.`acl` = 'open' 
					OR (
						(
							t.`acl` = 'private' 
							AND (
								t.`updateby` = #{srf.sessioncontext.srfloginname}  
								OR t.`createdby` = #{srf.sessioncontext.srfloginname} 
								OR t.`qd` =#{srf.sessioncontext.srfloginname} 
								OR t.`rd` = #{srf.sessioncontext.srfloginname} 
								OR t.`po` = #{srf.sessioncontext.srfloginname} 
							) 
						) 
						OR ( t.id IN ( SELECT t.root FROM zt_team t WHERE t.account =#{srf.sessioncontext.srfloginname}  AND t.type = 'product' ) ) 
					) 
				) 
)

